import React from 'react'
import './Recent.css'
import obitData from './obituaries'

const Recent = () => {

    const luna = obitData.map(item => {
        return (

            <div className='obits'>
                {/* {item.id} */}

                <p className='individual'>{item.title}</p>
                <p className='individual'>{item.name}</p>
                <p className='individual'>{item.date}</p>
            </div>
        )
    })
    console.log(luna)
  return (
    <div className='recent'>
        <h2 className="recent">Recent Deaths</h2>
        {luna}
    </div>
  )
}

export default Recent
